* {
  box-sizing: border-box; }
  * body, * header {
    font: 16px sans-serif;
    margin: 0;
    padding: 0; }
  * h1, * h2, * h3, * h4, * p, * ul, * a {
    margin: 0;
    padding: 0;
    list-style: none;
    text-decoration: none;
    color: black;
    font-weight: 100; }

body {
  background: #f4e7ce; }
  body .contact {
    font-family: "bahnschrift", Georgia;
    height: 100%; }
  body img {
    width: 35px;
    margin: 35px 0 15px 0; }
  body ul {
    display: flex;
    justify-content: flex-end;
    margin: 0 0 20px 0;
    justify-content: center; }
  body li {
    margin: 20px 20px 0 80px;
    letter-spacing: 1px;
    text-align: center; }
  body .contact__block {
    margin: 100px 400px 0 400px;
    justify-content: center; }
  body p {
    line-height: 35px;
    letter-spacing: 1.2px;
    font-size: 16px;
    margin: 10px 0 0 0;
    text-align: justify; }
  body .contact__links {
    margin: 50px 65px 0 0; }
